package java_lee_2;

public class ch4_11_ForMultiplicationTableExample {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		//구구단 출력하기
		
		for(int f=1;f<=9;f++) {
			for(int s=2;s<=9;s++) {
			System.out.print(s+"x"+f+"="+f*s+"\t");}
			System.out.println();
			
		}
		
	}
}
